{
    public static class UnsafeUtilities
    {
        public static unsafe void CopyBlock(void* destination, void* source, Int32 length)
        {
            Unsafe.CopyBlock(destination, source, length >= 0 ? (UInt32) length : 0);
        }
    }
    
    public static class Program
    {
        public static void Main(String[] args)
        {
            PolymorphicCat cat = new PolymorphicCat();
            cat.Voice();
            
            PolymorphicDog dog = new PolymorphicDog();
