    public unsafe struct PolymorphicAnimal
    {
        private const Int32 Maximum = 8;
        
        private fixed Byte Internal[Maximum];

        public Int32 Size { get; }

        public Boolean IsEmpty
        {
            get
            {
                return Size <= 0;
            }
        }
        
        private readonly delegate*<void*, void> _voice;
        private readonly delegate*<void*, Int32> _count;

        public Int32 Count
        {
            get
            {
                fixed (void* pointer = Internal)
                {
                    return _count(pointer);
                }
            }
        }
        
        public PolymorphicAnimal(Span<Byte> value, delegate*<void*, void> voice, delegate*<void*, Int32> count)
        {
            if (value.Length > Maximum)
            {
                throw new ArgumentOutOfRangeException(nameof(value), value.Length, "Size of value greater than maximum size");
            }
                
            fixed (void* source = value)
            fixed (void* destination = Internal)
            {
                UnsafeUtilities.CopyBlock(destination, source, Size = value.Length);
            }
            
            _voice = voice;
            _count = count;
        }

        public void Voice()
        {
            fixed (void* pointer = Internal)
            {
                _voice(pointer);
            }
        }
    }

    public unsafe struct PolymorphicCat
    {
        public static implicit operator PolymorphicAnimal(in PolymorphicCat value)
        {
            fixed (void* pointer = &value)
            {
                Span<Byte> span = new Span<Byte>(pointer, sizeof(PolymorphicCat));
                return new PolymorphicAnimal(span, &Voice, &GetCount);
            }
        }

        public Int32 Count { get; private set; }

        private static Int32 GetCount(void* self)
        {
            return Unsafe.AsRef<PolymorphicCat>(self).Count;
        }
        
        public void Voice()
