def check_instance(class_names, obj):
    instance_classes = []

    # Iterate through each class name
    for class_name in class_names:
        # Check if the object is an instance of the class
        if isinstance(obj, globals().get(class_name)):
            instance_classes.append(class_name)

    return instance_classes

