def check_inheritance(class_names):
    special_class = class_names[-1]  # Last element is the special class
    parents = []

    # Iterate through each class name except for the special class
    for class_name in class_names[:-1]:
        # Check if the class is a subclass of the special class
        if issubclass(special_class, globals().get(class_name)):
            parents.append(class_name)

    return parents

