def is_divisible(num, numbers):
    for n in numbers:
        if n != num and num % n == 0:
            return True
    return False

def main():
    input_string = input("Enter a string of integers separated by space: ")
    numbers = list(map(int, input_string.split()))

    divisible_numbers = [num for num in numbers if not is_divisible(num, numbers)]

    print("Numbers that can be divided without remainder by any other number in the list except for itself:")
    print(divisible_numbers)

if __name__ == "__main__":
    main()

def count_frequency(numbers):
    frequency = {}
    for num in numbers:
        if num in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
    return frequency

def main():
    input_string = input("Enter a string of numbers separated by space: ")
    numbers = list(map(int, input_string.split()))

    frequency = count_frequency(numbers)

    result = [num for num, freq in frequency.items() if freq > 2]

    print("Numbers that appeared more than two times:")
    print(result)

if __name__ == "__main__":
    main()

